// This is the carousel constructor to show images
import React, { Component } from 'react';
import HousesImageOne from './utilities/images/homes/one.jpg';
import HousesImageTwo from './utilities/images/homes/two.jpg';
import HousesImageThree from './utilities/images/homes/three.jpg';


export class Carousel extends Component {

  state = { 
  // array of images for the houses carousel
  HousesImage: [ HousesImageOne, HousesImageTwo, HousesImageThree, HousesImageFour, HousesImageFive, HousesImageSix], 
 // array of images for the Commercial Buildings carousel
  ComImage: [ HousesImageOne, HousesImageTwo, HousesImageThree, HousesImageFour, HousesImageFive, HousesImageSix], 
};


  render() {
    return (
      <div className="carousel-box">
          <img src={this.state.HousesImage[0]} />

      </div>
    )
  }
}

export default Carousel
